<style>
    /* logo */
    body {
        overflow: hidden;
    }
    
    .load_home_page {
        position: fixed;
        z-index: 9999;
        left: 0;
        top: 0;
        width: 100%;
        height: 100vh;
        background: #1e1f29;
        transition: 1s;
    }
    
    .load_home_page svg {
        max-width: 100%;
        position: absolute;
        width: 30%;
        height: 30%;
        z-index: 99;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        -webkit-transition: all 0.8s ease-in-out;
        -moz-transition: all 0.8s ease-in-out;
        -ms-transition: all 0.8s ease-in-out;
        -o-transition: all 0.8s ease-in-out;
        transition: all 0.8s ease-in-out;
    }
    
    .load_home_page svg path {
        stroke: #FFFFFF;
        stroke-width: 4px;
        stroke-dasharray: 9999;
        stroke-dashoffset: 9999;
        fill: transparent;
        transition: all 1s ease-in-out;
    }
    
    
    div.load_home_page .mask {
        background-color: #000;
        transition: 1s all ease-in-out;
        position: absolute;
        width: 100%;
        height: 100%;
    }
    
    .load_home_page.hidden .mask {
        background-color: transparent;
    }
    
    .load_home_page.hidden {
        visibility: hidden;
    }
    
    .load_home_page.hidden .mask span {
        width: 0;
        opacity: 0;
        transition-delay: 0.5s;
    }
    
    
    .load_home_page svg path.str1 {
        animation-name: Signature;
        animation-duration: 22s;
        animation-fill-mode: forwards;
        animation-timing-function: cubic-bezier(2, .25, .43, .96);
    }
    
    .load_home_page.hidden svg {
        transition-delay: 0.5s;
        opacity: 0;
    }
    
    .load_home_page.hidden path {
        fill: #FFFFFF;
    }
    
    @media only screen and (max-width: 1199px) {
        .load_home_page svg {
            width: 17rem;
        }
    }
    
    @media only screen and (max-width: 991px) {
        .load_home_page svg {
            width: 12rem;
        }
    
        .load_home_page svg path {
            stroke: #FFFFFF;
            stroke-width: 6px;
        }
    
    }
    
    @keyframes Signature {
        to {
            stroke: #FFF;
            stroke-dashoffset: 0;
        }
    }
    
    .load_home_page img {
        margin-top: 143px;
        height: 285px;
        margin-left: 25%;
        /* margin-right: 44%; */
    }
    </style>
